import Link from 'next/link';

const Index = () => (
	<div>
		<Link href='/about'>
			<a>About Page</a>
		</Link>
		<p>Hello Next.js</p>
		<a href="https://www.google.com/">Google</a>
	</div>
);

export default Index;
